use std::str::FromStr;
use regex::Regex;

fn is_valid_message( msg: &str ) -> bool
{
	println!("{}", msg);
	if msg.is_empty() { return true; }

	let re = Regex::from_str( r"^((\d+)([A-Za-z]*?))+$" ).unwrap();

	let mut found = false;

	for caps in re.captures_iter( msg )
	{
		found = true;

		let num: usize = caps[2].parse().unwrap();
		let txt        = &caps[3];

		if txt.len() != num
		{
			return false;
		}
	}

	found
}


